Description:
Tạo trang web đơn giản với cách hoạt động của website như sau: 
- có 2 portal là K-portal và V-portal; 
- có 5 mức phân quyền là: client, k-mgr, v-mgr, dev và admin; 
- các bước hệ thống hoạt động: 
Step-1: ạnh A (đã đăng kí trên K-portal với quyền client) tạo một yêu cầu cần hỗ trợ ở K-portal, yêu cầu này chỉ được hiển thị với anh A và k-mgr; 
Step-2: khi có yêu cầu trên K-portal, k-mgr trao đổi với client A qua comment (trực tiếp ở dưới - trong phần comment của yêu cầu của anh A); 
Step-3: sau khi trao đổi anh A kết thúc, k-mgr nhấn xác nhận yêu cầu, thì yêu cầu này sẽ được hiển thị ở V-portal và chỉ được nhìn thấy bới v-mgr; 
Step-4: v-mgr và k-mgr trao đổi qua comment như ở trên khi k-mgr trao đổi với anh A cho đến khi yêu cẩu được rõ ràng; 
Step-5: v-mgr nhấn xác nhận yêu cầu, khi đó yêu cầu sẽ hiển thị với tất cả những ai đăng kí trên v-portal với quyền là dev;
